import React from 'react'
import { useSelector } from 'react-redux';
import { Navigate } from 'react-router-dom';

const OpenRoute = ({children}) => {
  const token=useSelector((state)=>state.auth.token);
  if(token!=null){
    return <Navigate to="/" />;
  }
  else{
     return children;
  }
}

export default OpenRoute
